import React from 'react';

export const Flx = styled.div`
  display: flex;
  flex-direction: ${({ flexDirection }) => flexDirection};
`;

export const Flex = ({ children, flexDirection }) => <Flx flexDirection={flexDirection}>{children}</Flx>
